:deep(> .nav-bar) {
  height: calc(constant(safe-area-inset-top) + 120px);
  height: calc(env(safe-area-inset-top) + 120px);
}
.order-content {
  .order-content-container {
    min-height: 1000px;
    background-color: #f5faff;
    .tab-status-container {
      &::after {
        border-color: #d6dce8;
      }
    }
    :deep(.van-tabs__wrap) {
      height: 72px;
      .van-tabs__nav {
        margin-bottom: 24px;
        padding: 0 5px 0 5px;
        gap: 0 42px;
      }
      .van-tab {
        padding: 0;
        font-size: 22px;
      }
      .van-tab--active {
        font-size: 25px;
      }
      .van-tabs__line {
        bottom: 0;
      }
    }
  }
}
.nav-bar {
  padding-bottom: 45px;
}
.mine {
  position: relative;
  flex-direction: column;
  width: 100%;
  height: 100%;
  &.z-index-999 {
    z-index: 999;
  }
}

.action-btn {
  &:nth-child(1):after {
    content: '';
    height: 20px;
    position: absolute;
    right: 0;
    top: 50%;
    transform: translate3d(0, -50%, 0);
    border-right: 1px solid #000 !important;
  }
}

.no-data {
  width: 200px;
  margin: 0 auto;
  margin-top: 120px;

  img {
    width: 180px;
    height: 130px;
    margin: 0 auto 20px;
    // height: 110px;
  }

  .text-no-data {
    width: 100%;
    margin-bottom: 22px;
    color: #999;
    font-size: 28px;
    text-align: center;
  }
}

:deep(.van-tabs__nav) {
  background: transparent !important;

  &.active {
    color: var(--van-button-primary-background);
    font-weight: bold;
  }
}

:deep(.van-tab) {
  color: #868d9a;
  font-weight: normal;
}

:deep(.van-tab--active) {
  color: var(--van-button-primary-background) !important;
  font-weight: bold !important;
}

:deep(.date-action-sheet) {
  height: 542px;
  .van-action-sheet__close {
    color: #230503;
    // font-size: 29px;
    line-height: 90px;
  }
  .van-action-sheet__header {
    font-size: 42px;
    font-weight: bold;
  }
  .van-action-sheet__content {
    padding: 16px 28px 65px 28px;
  }
  .date-range-container {
    gap: 56px 35px;
    .item-date {
      flex: 0 0 207px;
      height: 69px;
      font-size: 39px;
      background-color: #fff;
      border-radius: 15px;
      border: solid 1px #d1d1d1;
      &.active {
        color: var(--app-color-font-date-choose-1);
        background-color: #e0ebfe;
        border: solid 1px var(--app-color-border-date-choose-1);
      }
    }
  }
  .item-btn {
    width: 320px;
    height: 80px;
    line-height: 80px;
    font-size: 39px;
    color: #fff;
    border-radius: 15px;
    text-align: center;
    &.btn-confirm {
      background-color: var(--van-button-primary-background);
    }
    &.btn-cancel {
      background-color: #8d8d8d;
    }
  }
}

